using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class NozzleInputModel : Notifier	{		public NozzleInputModel()		{					Mark = "";			Size = "";			Qty = "";			RatingFacing = "";			R = "";			H = "";			ORT = "";			Description = "";			Remarks = "";		}				private string _Mark;		public string Mark			{				get { return _Mark; }				set				{					_Mark = value;					OnPropertyChanged(nameof(Mark));				}			}				private string _Size;		public string Size			{				get { return _Size; }				set				{					_Size = value;					OnPropertyChanged(nameof(Size));				}			}				private string _Qty;		public string Qty			{				get { return _Qty; }				set				{					_Qty = value;					OnPropertyChanged(nameof(Qty));				}			}				private string _RatingFacing;		public string RatingFacing			{				get { return _RatingFacing; }				set				{					_RatingFacing = value;					OnPropertyChanged(nameof(RatingFacing));				}			}				private string _R;		public string R			{				get { return _R; }				set				{					_R = value;					OnPropertyChanged(nameof(R));				}			}				private string _H;		public string H			{				get { return _H; }				set				{					_H = value;					OnPropertyChanged(nameof(H));				}			}				private string _ORT;		public string ORT			{				get { return _ORT; }				set				{					_ORT = value;					OnPropertyChanged(nameof(ORT));				}			}				private string _Description;		public string Description			{				get { return _Description; }				set				{					_Description = value;					OnPropertyChanged(nameof(Description));				}			}				private string _Remarks;		public string Remarks			{				get { return _Remarks; }				set				{					_Remarks = value;					OnPropertyChanged(nameof(Remarks));				}			}			}}